import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

const StudentSignUp = ({ onLogin }) => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    fullName: '',
    rollNo: '',
    department: '',
    email: '',
    password: '',
    confirmPassword: '',
    agree: false
  });

  const [showPass, setShowPass] = useState(false);

  const styles = {
    container: {
      height: '100vh',
      width: '100%',
      fontFamily: "'Segoe UI', sans-serif",
      backgroundColor: '#f1f5f9',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      boxSizing: 'border-box',
      padding: '15px'
    },
    formWrapper: {
      width: '100%',
      maxWidth: '420px',
      backgroundColor: '#fff',
      borderRadius: '12px',
      padding: '20px',
      boxShadow: '0 4px 15px rgba(0,0,0,0.08)'
    },
    header: {
      textAlign: 'center',
      marginBottom: '12px'
    },
    backBtn: {
      display: 'inline-flex',
      alignItems: 'center',
      color: '#64748b',
      fontSize: '13px',
      cursor: 'pointer',
      marginBottom: '10px',
      padding: '4px 0'
    },
    title: {
      fontSize: '22px',
      fontWeight: '700',
      color: '#0f172a',
      margin: '0 0 3px 0'
    },
    subtitle: {
      fontSize: '13px',
      color: '#94a3b8'
    },

    toggleContainer: {
      display: 'flex',
      backgroundColor: '#f1f5f9',
      borderRadius: '8px',
      padding: '3px',
      marginBottom: '15px'
    },
    toggleBtn: (active) => ({
      flex: 1,
      border: 'none',
      padding: '8px',
      borderRadius: '6px',
      fontSize: '13px',
      fontWeight: '600',
      cursor: 'pointer',
      backgroundColor: active ? '#0ea5e9' : 'transparent',
      color: active ? '#fff' : '#64748b',
      transition: 'all 0.2s'
    }),

    form: {
      display: 'flex',
      flexDirection: 'column',
      gap: '10px'
    },
    row: {
      display: 'grid',
      gridTemplateColumns: '1fr 1fr',
      gap: '10px'
    },
    col: {
      display: 'flex',
      flexDirection: 'column'
    },
    label: {
      fontSize: '11px',
      fontWeight: '600',
      color: '#334155',
      marginBottom: '4px'
    },
    input: {
      width: '100%',
      padding: '8px 10px',
      borderRadius: '6px',
      border: '1px solid #e2e8f0',
      fontSize: '13px',
      outline: 'none',
      backgroundColor: '#f8fafc',
      boxSizing: 'border-box',
      color: '#1e293b'
    },

    select: {
      width: '100%',
      padding: '8px 10px',
      borderRadius: '6px',
      border: '1px solid #e2e8f0',
      fontSize: '13px',
      outline: 'none',
      backgroundColor: '#f8fafc',
      boxSizing: 'border-box',
      color: '#1e293b',
      cursor: 'pointer'
    },

    checkboxRow: {
      display: 'flex',
      alignItems: 'center',
      gap: '8px',
      fontSize: '11px',
      color: '#64748b'
    },
    checkbox: {
      width: '14px',
      height: '14px',
      accentColor: '#0ea5e9',
      cursor: 'pointer'
    },
    linkHighlight: {
      color: '#0ea5e9',
      fontWeight: '600',
      textDecoration: 'none'
    },

    submitBtn: {
      width: '100%',
      padding: '10px',
      borderRadius: '8px',
      border: 'none',
      backgroundColor: '#0ea5e9',
      color: '#fff',
      fontSize: '14px',
      fontWeight: '700',
      cursor: 'pointer',
      boxShadow: '0 2px 8px rgba(14, 165, 233, 0.3)',
      marginTop: '5px'
    },
    loginLink: {
      textAlign: 'center',
      fontSize: '12px',
      color: '#94a3b8',
      marginTop: '10px'
    },

    passWrapper: {
      position: 'relative'
    },
    passToggle: {
      position: 'absolute',
      right: '8px',
      top: '50%',
      transform: 'translateY(-50%)',
      background: 'none',
      border: 'none',
      cursor: 'pointer',
      color: '#94a3b8',
      fontSize: '11px',
      padding: '2px'
    }
  };

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (formData.password === formData.confirmPassword && formData.agree) {
      onLogin({ 
        name: formData.fullName || 'New Student', 
        email: formData.email, 
        role: 'student',
        college: 'Engineering Tech Institute' 
      });
      navigate('/');
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.formWrapper}>
        {/* Header */}
        <div style={styles.header}>
          <div style={styles.backBtn} onClick={() => navigate('/')}>
            ‚Üê Back
          </div>
          <h1 style={styles.title}>Create Account</h1>
          <p style={styles.subtitle}>Sign up to get started</p>
        </div>

        {/* Toggle */}
        <div style={styles.toggleContainer}>
          <button style={styles.toggleBtn(true)}>Student</button>
          <button style={styles.toggleBtn(false)} onClick={() => navigate('/teacher-signup')}>Teacher</button>
        </div>

        {/* Form */}
        <form style={styles.form} onSubmit={handleSubmit}>

          {/* Full Name */}
          <div style={styles.col}>
            <label style={styles.label}>Full Name</label>
            <input 
              style={styles.input} 
              placeholder="Your name" 
              name="fullName" 
              value={formData.fullName}
              onChange={handleChange}
            />
          </div>

          {/* Row: Roll No + Dept */}
          <div style={styles.row}>
            <div style={styles.col}>
              <label style={styles.label}>Roll No</label>
              <input 
                style={styles.input} 
                placeholder="ID-2024" 
                name="rollNo" 
                value={formData.rollNo}
                onChange={handleChange}
              />
            </div>
            <div style={styles.col}>
              <label style={styles.label}>Dept</label>
              <select 
                style={styles.select} 
                name="department" 
                value={formData.department}
                onChange={handleChange}
              >
                <option value="">Select</option>
                <option value="CSE">CSE</option>
                <option value="ECE">ECE</option>
                <option value="MECH">MECH</option>
                <option value="CIVIL">CIVIL</option>
                <option value="IT">IT</option>
                <option value="EEE">EEE</option>
              </select>
            </div>
          </div>

          {/* Email */}
          <div style={styles.col}>
            <label style={styles.label}>Email</label>
            <input 
              style={styles.input} 
              type="email" 
              placeholder="student@college.edu" 
              name="email" 
              value={formData.email}
              onChange={handleChange}
            />
          </div>

          {/* Password Row */}
          <div style={styles.row}>
            <div style={styles.col}>
              <label style={styles.label}>Password</label>
              <div style={styles.passWrapper}>
                <input 
                  style={styles.input} 
                  type={showPass ? "text" : "password"} 
                  placeholder="Create" 
                  name="password" 
                  value={formData.password}
                  onChange={handleChange}
                />
                <button 
                  type="button" 
                  style={styles.passToggle}
                  onClick={() => setShowPass(!showPass)}
                >
                  {showPass ? 'Hide' : 'Show'}
                </button>
              </div>
            </div>
            <div style={styles.col}>
              <label style={styles.label}>Confirm</label>
              <input 
                style={styles.input} 
                type="password" 
                placeholder="Confirm" 
                name="confirmPassword" 
                value={formData.confirmPassword}
                onChange={handleChange}
              />
            </div>
          </div>

          {/* Terms */}
          <div style={styles.checkboxRow}>
            <input 
              type="checkbox" 
              style={styles.checkbox}
              checked={formData.agree}
              onChange={handleChange}
              name="agree"
              id="agree"
            />
            <label htmlFor="agree" style={{cursor: 'pointer', flex: 1}}>
              I agree to <Link to="/terms" style={styles.linkHighlight}>Terms</Link> & <Link to="/privacy" style={styles.linkHighlight}>Privacy</Link>
            </label>
          </div>

          {/* Submit */}
          <button type="submit" style={styles.submitBtn}>
            Create Account
          </button>

          <div style={styles.loginLink}>
            Have an account? <Link to="/signin" style={styles.linkHighlight}>Login</Link>
          </div>
        </form>
      </div>
    </div>
  );
};

export default StudentSignUp;
